"use strict";

import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';


class App extends React.Component {
	render() {
		var test = "Hello, World";
		
		return (
			<div>
				<h1>{test}</h1>
			</div>
		);
	}
}


export default App;
